/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<ui5-responsive-popover	id="${ifDefined(context._id)}-overflowMenu"	horizontal-align="Right"	placement-type="Bottom"	content-only-on-desktop	with-padding	no-arrow	_hide-header><ui5-list @ui5-itemPress="${ifDefined(context._onOverflowListItemSelect)}">		${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</ui5-list><div slot="footer" class="ui5-responsive-popover-footer"><ui5-button			design="Transparent"			@click="${context._closeRespPopover}"		>Cancel</ui5-button></div></ui5-responsive-popover>`; };
const block1 = (item, index, context) => { return html`${ !item.isSeparator ? block2(item, index, context) : undefined }`; };
const block2 = (item, index, context) => { return html`${ifDefined(item.overflowPresentation)}`; };

export default block0;
